import React from "react";

const Cross = () => {
    
    return(
    <>
    <html>
    <div>
    <table style={{width: '250px'}} className="border mx-auto px-3 p-2">
        <tr>
            <td>1</td>
            <td>2</td>
            <td>3</td>
        </tr>
    </table>
    </div>
    </html>
    </>
    )
}

export default Cross;
